import './App.css';
import Navbar from './components/Navbar';
import Card from './components/Card';
import placesData from './assets/placesData';
import axios from 'axios';

function App() {
  function getTrips(){
    axios.get("https://d6svkzibzlbl3o3cqf3bcg3aqu0ivhop.lambda-url.us-east-1.on.aws/").then(
        response => alert(response.data)
    )
  }

  getTrips()


  const visitedPlaces = placesData.map(visit => 
    <Card
      key={visit.id}
      {...visit}
    />  
  )

  return (
    <div>
      <Navbar/>
      {visitedPlaces}
    </div>
  );
}

export default App;
